informacaoComplementar:
Para a realização do 3º Congresso Amazônico de Licitações e Contratações Públicas, a empresa contratada será responsável pelos seguintes serviços e estruturas:

Do Local e Horário de Realização dos Serviços:

Os serviços serão executados na cidade de Porto Vleho-RO, na modalidade presencial, em dependências ofertada pela contratada.

Local do evento: Auditório da Faculdade Católica de Rondônia;

Data: 02 a 04 de Abril de 2025. Horário: do 1º 8h30 às 20h e no 2º e 3º dia das 8h30 às 18h;

Carga Horária: 24 horas;

Duração: 03 dias.

Serviços Inclusos:

Material didático - legislação e slides

Material de apoio - Apostila impressa com conteúdo exclusivo do evento

Certificado geral com carga horária de 24 horas disponibilizado através da plataforma

Infraestrutura do Evento:

Locação do espaço para realização do congresso;

Equipamentos de áudio e vídeo para transmissão e gravação das palestras;

Iluminação e sonorização adequadas ao porte do evento;

Palco e estrutura para os palestrante

Material e Serviços de Apoio:

Material gráfico e digital para divulgação;

Credenciamento e controle de acesso dos participantes;

Impressão de certificados e materiais de apoio;

Kit para congressistas (crachás, blocos de anotações, canetas, etc.).

Alimentação:

Coffee breaks e coquetéis para os participantes;

Serviços de catering para palestrantes e equipe organizadora.
O evento, considerado o maior evento de licitações e contratos administrativos da região Norte do país, será realizado pela instituição EDUCAGOV CURSOS E TECNOLOGIA LTDA e contará com palestrantes renomados, conteúdo exclusivo e oportunidades valiosas de networking. Os participantes terão a chance de discutir as principais atualizações sobre a Lei 14.133/2021 e trocar experiências com profissionais de destaque no campo das licitações e contratos administrativos.
O 3 º Congresso Amazônico de Licitações e Contratações Públicas é um evento de grande relevância para profissionais da área de compras governamentais, licitações e contratos administrativos.
